import styled from "styled-components";
import React from "react";
// import Abel_Regular from 'src/assets/font/Abel_Regular.woff';



const Body_Back = styled.div`
  display: flex;
  width: 100%;
  flex-direction: column;
  align-items: center;
  flex-shrink: 0;
`;
const Body_Center = styled.div`
  display: flex;
  width: 55%;
  height: 800px;
  flex-direction: column;
  align-items: center;
  //align-items: flex-start;
  flex-shrink: 0;
`;

const Profile = styled.div`
  width: 100%;
  height: 230px;
  padding-bottom: 30px;
  align-items: flex-start;
  flex-shrink: 0;
  border-bottom: 2px solid lightgrey;
  display: flex;
`;
const ProfileImg = styled.div`
  flex: 2;
  padding-left: 130px;
  margin: 50px 50px 50px 70px;
  height: 70%;
`;
const ProfileText = styled.div`
    flex: 8;
  height: 70%;
  margin: 50px 50px 50px 50px;
  text-align: left;
`;
const Img = styled.img`
    width: 150px;
  height: 150px;
  border-radius: 50%;
  border: 1px solid gray;
`;

const T = styled.div`

`;
// ProfileText 안에 들어갈 내용들
const T1 = styled.div`
    font-size: 30px;
  font-style: normal;
  color: var(--Black, #262626);
  padding-bottom: 25px;
`;
const T2 = styled.div`
    font-size: 15px;
  padding-bottom: 20px;
`;
const T3 = styled.div`
    font-size: 15px;
`;

const NavBox = styled.div`
  display: flex;
    height: 50px;
  width: 30%;
  align-items: center;
  flex-direction: row;
  border-bottom::5px;
  padding-top: 20px;
`;
const Btn = styled.div`
    width: 70px;
  margin : 0 auto;
`;
const Posts = styled.div`
  display: flex;
  height: 100%;
  width: 100%;
  align-items: center;
  flex-direction: row;
  border-bottom::5px;
`;
const PostImg = styled.img`
    width: 30%;
  padding: 3%;
`;

export default function Body() {
    return(
        <Body_Back>
            <Body_Center>
                <Profile>
                    <ProfileImg>
                        <Img src={"img/mayo.jpg"}></Img>
                    </ProfileImg>
                    <ProfileText>
                        <T><T1>mynameis_mayo</T1></T>
                        <T2>게시물 3 팔로우 20 팔로워 25</T2>
                        <T3>Pomeranian</T3>
                    </ProfileText>
                </Profile>
                <NavBox>
                    <Btn>
                        <img src={"img/Posts.png"} width={"20px"}></img>
                        게시물
                    </Btn>
                    <Btn>
                        <img src={"img/Save.png"} width={"20px"}></img>
                        저장됨
                    </Btn>
                    <Btn>
                        <img src={"img/Tagged.png"} width={"20px"}></img>
                        태그됨
                    </Btn>
                </NavBox>
                <Posts>
                    <PostImg src={"img/1.png"}></PostImg>
                    <PostImg src={"img/2.png"}></PostImg>
                    <PostImg src={"img/1.png"}></PostImg>
                </Posts>
            </Body_Center>
        </Body_Back>
    );
}
